def get_sentence(demo1, x, args_method, args_cot_trigger, args_direct_answer_trigger_for_zeroshot):
    if args_method == "zero_shot":
        k = x + " " + args_direct_answer_trigger_for_zeroshot
    elif args_method == "zero_shot_cot":
        k = x + " " + args_cot_trigger
    elif args_method in ("few_shot", "few_shot_cot"):
        k = str(demo1) + x
    elif args_method == "auto_cot":
        k = str(demo1) + x + " " + args_cot_trigger
    else:
        raise ValueError(f"Unknown method: {args_method}")
    return k
